sources.styles\\_reset.scss:
@import "variables";

html,
body,
ul,
li,
button,
input,
textarea,
h1,
h2,
h3 {
  margin: 0;
  border-width: 0;
  padding: 0;
  font-family: "Ubuntu", sans-serif;
  font-style: 16px;
  line-height: inherit;
}

body {
  line-height: 1.5;
}

strong {
  font-weight: 500;
}

a {
  color: $link-color;
  text-decoration: none;
}

sources.styles\\_header.scss:
@import "variables";

.header {
  position: relative;
  height: 765px;

  background-image: url(../images/header.jpg);
  background-size: cover;
  background-position: 34% 0%;

  font-weight: 500;
  line-height: 1;

  &__nav {
    position: absolute;
    bottom: 25px;
    right: 0;
    left: 0;
  }

  &__top {
    position: absolute;
    display: flex;
    flex-wrap: wrap;
    top: 35px;
    left: calc(50% - #{$logo-width / 2});
  }

  &__phone {
    margin: 0 82px;
    color: $link-color;
    text-transform: uppercase;
  }

  &__phone,
  &__action {
    position: relative;
    top: 41px;
  }

  &__link {
    color: $link-color;
    text-transform: uppercase;
    text-decoration: none;
    border-bottom: 1px dashed $link-color;
    transition: color $transition-duration;

    &:hover {
      color: $active-color;
    }
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .header {
    &__top {
      flex-direction: column;
    }

    &__phone {
      margin: -30px 0 10px;
    }
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .header {
    &__nav {
      margin-bottom: 40px;
    }
  }
}

