sources.styles\\_heading.scss:
.heading {
  font-size: 48px;
  line-height: 1;
  position: absolute;
  text-transform: uppercase;
  font-weight: 300;
  width: max-content;

  &::before,
  &::after {
    content: "";
    display: block;
    position: absolute;
    top: calc(100% + 4px);
    height: 2px;
    width: calc(50% - 20px);

    background-color: $highlight-color;
  }

  &::before {
    left: 0;
  }

  &::after {
    right: 0;
  }

  &__crown {
    display: block;
    position: absolute;
    left: 0;
    right: 0;
    top: calc(100% + 4px);
    width: 20px;
    height: 13px;
    margin: auto;

    background-image: url(../images/crown.svg);
  }
}

@media screen and (max-width: $mobile-breakpoint) {
  .heading {
    font-size: 40px;
  }
}

sources.styles\\_photos.scss:
@import "variables";

.photos {
  $gap: 20px;
  display: flex;
  justify-content: space-between;

  &__img {
    width: calc(50% - #{$gap / 2});
    height: 260px;
    object-fit: cover;
    object-position: center;
    transition-duration: $transition-duration;
  }

  &__img:hover {
    transition-duration: $transition-duration;
    transform: scale(1.5);
    z-index: 3;
  }

  &--wide-left {
    .photos__img:first-child {
      width: calc(67% - #{$gap / 2});
    }

    .photos__img:last-child {
      width: calc(33% - #{$gap / 2});
    }
  }

  &--wide-right {
    .photos__img:first-child {
      width: calc(33% - #{$gap / 2});
    }

    .photos__img:last-child {
      width: calc(67% - #{$gap / 2});
    }
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .photos {
    flex-direction: column;

    &__img {
      width: 99vw;
      margin: 10px 0;

      &:hover {
        transform: scale(1);
      }
    }

    &--wide-left {
      .photos__img:first-child {
        width: 99vw;
      }

      .photos__img:last-child {
        width: 99vw;
      }
    }

    &--wide-right {
      .photos__img:first-child {
        width: 99vw;
      }

      .photos__img:last-child {
        width: 99vw;
      }
    }
  }
}

