sources.styles\\_person.scss:
.person {
  text-align: center;
  transition-duration: 1s;

  &__photo {
    width: 150px;
    height: 150px;
    border-radius: 50%;
    transition-duration: 1s;

  }

  &:hover &__photo {
    border-radius: 5% 5% 25% 25%;
    transition-duration: 1s;
  }

  &:hover {
    transform: scale(1.2);
    transition-duration: scale 1s;
    background-color: #00abef49;
    border-radius: 20px;
  }

  &__name {
    margin-top: 12px;
    font-weight: 700;
  }

  &__position {
    margin: 0;
    color: #696973;
    font-style: italic;
  }

  &__text {
    position: relative;

    &::after {
      content: "";
      display: block;
      position: absolute;
      width: 40px;
      height: 33px;
      background-image: url(../images/quotes.svg);
      /* background: contain no-repeat center; */
      background-size: contain;
      background-repeat: no-repeat;
      background-position: center;
      right: calc(100% + 6px);
      bottom: calc(100% + 6px);
    }
  }
}

